import React from 'react';
import './dashboardpanel.scss';
import { NavLink } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <div className="dashboard__links">
        <ul>
          <li><NavLink to={"/"}>New Post</NavLink></li>
          <li><NavLink to={"/"}>All Posts</NavLink></li>
          <li><NavLink to={"/"}>All Tags</NavLink></li>
          <li><NavLink to={"/"}>All Categories</NavLink></li>
          <li><NavLink to={"/"}>Update Profile</NavLink></li>
          <li><NavLink to={"/"}>All Comments</NavLink></li>
        </ul>
      </div>
    </div>
  );
};

export default Dashboard;
